ISLAMABAD, Jun 18 (APP):The National Assembly session, presided over by Deputy Speaker Ghulam Mutafa Shah, began at 11:06 a.m. on Wednesday.
The House resumed debate on the Finance Bill 2025 for the fifth consecutive day, with members actively participating in discussions on the proposed federal budget.
